import React, { useEffect, useState } from 'react';
import SectionGrowthChart from '../Charts/Sectiongrowthchart';

const HeadmasterDashboard = () => {
  const [sections, setSections] = useState([]);

  useEffect(() => {
    fetch('/api/sections')
      .then(res => res.json())
      .then(setSections);
  }, []);

  return (
    <div className="p-4">
      <h2 className="text-2xl mb-4">School Overview</h2>
      <SectionGrowthChart data={sections} />
    </div>
  );
};

export default HeadmasterDashboard;
